Te presentamos hace un tiempo a esta joven artista de tan solo 16 años quien ha  lanzado su álbum debut «Mi Paz» en la Madre Patria y que no dejará a nadie insatisfecho por la variedad de estilos que recorre en su música 🎶

Cuando escuchen por primera vez a Gisela Hidalgo no podrán creer la edad que tiene 🎤
Ella ha aprovechado el tiempo de confinamiento para sacar su primer disco  en el cuál, la cantautora mantiene firme sus influencias de Rock, Pop con matices de Soul, creando algo nuevo que sin salirse de los esquemas del Pop-Rock le da un toque especial y sorprende 😃

«Es algo bastante innnovador y en lo personal me llena muchísimo» palabras de Gisela, con ganas de volver a los escenarios para compartir con todo su público lo que este disco le transmite a ella personalmente.

¿A que se debe el nombre de «Mi Paz»?

«Mi Paz», es el tema favorito de sus padres y como homenaje a ellos por haber confiado en ella permaneciendo a su lado, decidió ponerle ese nombre a su disco.

¿De dónde viene la pasión por la música de Gisela?

Gisela Hidalgo cuenta que su pasión por la música nació en ella después de atravesar unos momentos complicados  para ella, refugiándose allí. Fue entonces cuando se dio cuenta que la música le había dado todo, y que la forma más bonita de agradecerle el haber pasado junto a ella esos momentos difíciles era dedicándose a ella 📀🎶 

*Ella* así se titula este tercer single que estrenará y el cual te estamos presentando en exclusiva  @WORLDMUSICARGENTINA 📻🎶 Llega otro éxito en la voz de Gigi 🎶🎶 
